INSERT INTO "events" VALUES (1,'CLEANUP','2008-10-08 09:30:00','8th & Cumberland in North Philly','Hartranft Orchard','Existing orchard needs some assistance with weeding and other tasks. \nRAINDATE: Thursday, October 9, 9:30am\n\n','2008-10-08 15:10:41','2008-10-08 15:10:41',NULL,NULL,1),(2,NULL,'2008-10-17 19:10:00','Washington DC','United States Botanic Garden','Assistance is needed in removing plants from POP display orchard to bring back for planting in Philly orchards.','2008-10-08 15:11:31','2008-10-08 15:11:31','Thursday and Friday, October 16 & 17',NULL,1),(3,'PLANTING','2008-10-18 10:00:00','6th & Indiana in North Philly','Potter Thomas Elementary Orchard','Help plant an orchard on Philly Cares Day!','2008-10-08 15:12:15','2008-10-08 15:12:15',NULL,NULL,1),(4,'SITE PREP','2008-10-26 10:30:00','On Dauphin St. west of 33rd in East Fairmount Park','WOODFORD ORCHARD','Help spread a huge mound of mushroom compost to prepare the soil for planting!  ','2008-10-20 16:51:53','2008-10-24 22:22:35','RAINDATE: October 26, 2008 10:30 AM',NULL,1),(5,'PLANTING','2008-10-28 09:30:00','N. 7th & W. Boston in North Philly','HARTRANFT ORCHARD','Come join us in working with students from Hartranft Elementary to complete the planting of this orchard, one piece of the transformation of the site by the Mural Arts \"Restored Places\" program.    RAINDATE: Wednesday, October 29, 9:30am','2008-10-20 17:02:25','2008-10-20 17:36:24',NULL,NULL,1),(6,'PLANTING','2008-11-08 11:00:00','on Dauphin St west of 33rd in East Fairmount Park','WOODFORD ORCHARD','Join us for a planting and other activities at historic Woodford Mansion!  This orchard is being planted in an exciting partnership between POP, East Park Revitalization Alliance, Woodford Mansion, and Fairmount Park. \nRAINDATE: Saturday, November 9, 11am','2008-10-20 17:06:01','2008-10-20 17:39:49',NULL,NULL,1),(7,'RAINDATE PLANTING','2008-11-16 14:00:00','9th & Indiana in North Philly','FAIRHILL ORCHARD','Lend a hand with the planting of an orchard at the historic Fairhill Burial Ground.  ','2008-10-20 17:35:49','2008-11-14 22:26:12',NULL,NULL,1),(8,'PLANTING','2008-11-10 15:00:00','6100 Stenton Ave, North Philly','MLK HS ORCHARD','Join students in planting figs, kiwi vines, and berry bushes at the MLK High School farm, a partnership with nearby Weavers Way Farm.  \nRAINDATE: Friday, 11/14 at 3pm.  ','2008-11-07 03:40:21','2008-11-07 03:53:58',NULL,NULL,1),(9,'PLANTING','2008-11-22 10:00:00','815 Perkiomen St, just N of Francis St  in North Philly','FRANCISVILLE ORCHARD','Orchard planting in partnership with the Francisville NDC and Community Ventures. \nRAINDATE: Sunday, 11/23 at 10am. ','2008-11-07 03:52:29','2008-11-07 03:52:29',NULL,NULL,1),(12,'POP Nursery Site Prep','2009-04-04 09:30:00','in Awbury Arboretum','Weavers Way Farm','Help the Orchard Project prepare a new space for its edible plant nursery.  Many fun tasks like pulling weeds and spreading mulch! See (www.weaversway.coop/index.php?page=185) for directions.  RAINDATE: Saturday April 11 @ 9:30am','2009-03-25 02:43:10','2009-03-25 02:51:51',NULL,NULL,1),(13,'PLANTING','2009-04-22 14:00:00','NW of 33rd & Dauphin in East Fairmount Park','WOODFORD ORCHARD','Help out youth from the East Park Revitalization Alliance in planting strawberries and perennials as an understory to the orchard planted last fall.  Or just see the orchard and take a tour of historic Woodford Mansion!  \nRAINDATE: April 23 at 4:30pm','2009-04-05 20:58:24','2009-04-07 16:45:51',NULL,NULL,1),(14,'SITE PREP','2009-05-09 10:00:00','RAPCS, 58th & Lindbergh in West Philly','RICHARD ALLEN ORCHARD','Good with a wheelbarrow, shovel, or rake? Lend a hand with students, teachers, and neighborhood families in preparing the site for our new orchard planting at the Richard Allen Preparatory Charter School.  \nRAINDATE: Sunday, May 10 @ 1pm','2009-04-19 16:25:55','2009-04-19 16:34:38',NULL,NULL,1),(15,'PLANTING','2009-05-12 13:00:00','RAPCS, 58th & Lindbergh in West Philly','RICHARD ALLEN ORCHARD','Join the students of Richard Allen Preparatory Charter School in planting an orchard including pears, figs, persimmons, raspberries, currants, strawberries, and more!  \nRAINDATE: Wednesday, May 13 @ 11am','2009-04-19 16:31:03','2009-04-19 16:37:04',NULL,NULL,1),(16,'PLANTING','2009-05-02 10:00:00','Woodford Mansion, NW of 33rd & Dauphin in East Fairmount Park','WOODFORD ORCHARD','Please join us for a weeding and strawberry planting party!\nRAINDATE: Sunday, May 3, @ 1pm','2009-04-24 12:48:31','2009-04-24 12:48:31',NULL,NULL,1),(17,'CLEANUP','2009-06-09 16:30:00','8th & Emily in South Philly','UCSEP ORCHARD','Help UCSEP''s Youth Leadership Council in sprucing up POP''s first orchard.  ','2009-06-03 23:16:18','2009-06-03 23:27:49',NULL,NULL,1),(18,'CLEANUP','2009-07-25 10:00:00','Cambria & D in Kensington, North Philly','CAMBRIA ORCHARD','Lend a helping hand with volunteers from Circle Venture and the neighborhood in an orchard cleanup day.  Easily accessible by subway!\nRAINDATE: Sunday, July 26 @12pm','2009-06-03 23:22:05','2009-06-29 16:57:07',NULL,NULL,1),(19,'CLEANUP','2009-06-27 13:00:00','NW of 33rd & Dauphin in East Fairmount Park','WOODFORD ORCHARD','Help this young orchard get established by assisting Woodford and the East Park Revitalization Alliance with an afternoon of weeding and mulching. ','2009-06-03 23:27:06','2009-06-03 23:33:48',NULL,NULL,1),(20,'CLEANUP','2009-06-19 12:15:00','8th & Cumberland in North Philly','HARTRANFT ORCHARD','Join the students of Hartranft Elementary in caring for their orchard- and see the marvelous results of one of Mural Arts'' Transformed Spaces!','2009-06-08 13:22:12','2009-06-08 13:22:12',NULL,NULL,1),(21,'WORK DAY','2009-07-11 09:00:00','Weavers Way Farm @ Awbury Arboretum','POP NURSERY','Lend a hand mulching, weeding, and potting plants at POP''s new edible plant nursery at Weavers Way Farm.  See (www.weaversway.coop/index.php?page=185) for directions.  RAINDATE: Sunday, July 12 @ 10am','2009-07-02 13:54:35','2009-07-02 21:12:38',NULL,NULL,1),(22,'APPLE FESTIVAL','2009-10-03 10:00:00','NW of 33rd & Dauphin, East Fairmount Park','Woodford Orchard','Please join us for this community event at the Woodford Mansion Children''s Orchard.  We''ll get started with an orchard cleanup and new plantings, followed by a cookout, cider pressing, and other activities.  \nRAINDATE: Sunday, 10/4 @ 10am','2009-09-02 15:51:23','2009-09-02 15:54:28',NULL,NULL,1),(23,'CARE DAY','2009-10-10 10:00:00','4300 Germantown Ave, Nicetown','NICETOWN ORCHARD','Lend a hand alongside volunteers from the Nicetown neighborhood.  Mulching, weeding, fun for all. . . \nRAINDATE: Sun, 10/11 @ 10am','2009-09-21 01:07:50','2009-10-06 13:23:12',NULL,NULL,1),(25,'SOIL PREP','2009-10-26 10:00:00','3016 Percy St, North Philly','WCRP ORCHARD','Preparation for a new community orchard in partnership with the Women''s Community Revitalization Project (www.wcrpphila.com).  Help out alongside residents and neighbors as we spread a mountain of compost!  RAINDATE: Tues, 10/27 @ 10am.   ','2009-09-30 20:45:34','2009-10-06 13:03:31',NULL,NULL,1),(26,'PLANTING','2009-10-31 10:00:00','3016 Percy St, North Philly','WCRP ORCHARD','Help plant a new community orchard with residents and neighbors of the Women''s Community Revitalization Project (www.wcrpphila.com).  Fruit trees, berry bushes, perennial herbs!  RAINDATE: Sun, 11/1 @ noon.','2009-09-30 20:51:01','2009-10-06 13:04:40',NULL,NULL,1),(27,'PLANTING','2009-10-31 10:00:00','8230 Ridge Ave, Roxborough','ROXBOROUGH ORCHARD','Lend a hand in planting a new orchard at the Roxborough Presbyterian Community Garden.  Part of the Church''s HarvestFest event (8am-3pm), with garden tours, a cookout, baking contest, games, music, and more!  RAINDATE (Planting only): 11/1 @ 1pm','2009-09-30 21:00:10','2009-09-30 21:03:04',NULL,NULL,1),(28,'CLEANUP RAINDATE','2009-10-31 10:00:00','8th & Poplar','TEENS 4 GOOD ORCHARD','Help out at one of Philly''s most exciting youth-run farms: preparing garden beds, weeding, and adding some new fruit trees and kiwi vines to the orchard!  Bring you gloves and get ''em dirty!  ','2009-10-05 00:20:29','2009-10-23 01:59:10',NULL,NULL,1),(29,'CARE DAY','2009-10-23 10:00:00','7th & Boston St, North Philly','HARTRANFT ORCHARD','The young orchard caretakers of Hartranft Elementary need your help!  Pull some weeds alongside students and teachers and check out one of the Mural Arts Program''s Transformed Spaces.  ','2009-10-06 13:07:22','2009-10-06 13:07:22',NULL,NULL,1),(30,'PLANTING','2009-10-13 09:00:00','23rd & Sansom, Center City','GREENFIELD ORCHARD','The greening of Greenfield Elementary will include a new orchard!  Help the students of Greenfield plant this new school resource.  RAIN DATE: Wed, 10/14 @ 9am','2009-10-06 14:39:20','2009-10-06 14:40:27',NULL,NULL,1),(31,'PREP & PLANTING','2009-11-14 10:00:00','2901 Hunting Park Ave in Allegheny, North Philly','SHARE ORCHARD','Please join us for our season finale, planting a community orchard with SHARE (sharefoodprogram.org).  Help spread a mountain of compost and plant an orchard that will get fresh produce out to those who need it most!  \nRAINDATE: Sun, 11/15 @ 10am','2009-10-15 20:10:22','2009-10-15 20:13:41',NULL,NULL,1),(32,'WORK DAY','2009-11-21 10:00:00','Weavers Way Farm & Awbury Arboretum','POP NURSERY','Lend a hand potting up plants for next year at POP''s new edible plant nursery at Weavers Way Farm.  See (www.weaversway.coop/index.php?page=185) for directions.  RAINDATE: Sunday, November 22 @ 10am','2009-11-12 15:53:31','2009-11-12 15:53:31',NULL,NULL,1),(33,'PLANTING','2010-04-16 12:30:00','2901 Hunting Park Ave, Allegheny','SHARE ORCHARD','Join us for this exciting event, which will include a tour of the SHARE and Common Market, a workshop on composting and permaculture, and new orchard plantings. \nRAINDATE: Thurs, 4/29 @ 12:30pm. ','2010-03-23 22:14:06','2010-03-29 15:24:59',NULL,NULL,1),(34,'PLANTING','2010-04-17 10:00:00','8230 Ridge Ave