e @ Awbury Arboretum, 1 Awbury Road, Philadelphia','AWBURY','This workshop, led by Peter Bane and Phil Forsyth, will introduce Permaculture strategies to build resilient and abundant cities and neighborhoods.  1-4pm.  Seating limited, registration required at http://www.awbury.org/permaculture.  ','2012-11-21 00:48:53','2012-11-21 00:48:53',NULL,NULL,0),(164,'WORK DAY','2012-11-29 13:00:00','Weavers Way Farm @ Awbury Arboretum, Germantown','POP NURSERY','Help out with preparing our nursery space for winter.  See (www.weaversway.coop/index.php?page=185) for directions.','2012-11-26 16:58:29','2012-11-26 16:59:01',NULL,4,1),(165,'FRUIT PRUNING SIMPLIFIED','2013-03-10 10:00:00','Cope House @ Awbury Arboretum, 1 Awbury Road, Philadelphia','AWBURY ARBORETUM','POP is bringing orchard all-star Lee Reich to town to lead this exciting full day workshop.  Reich will cover fruit growing from a number of angles, with a focus on hands-on pruning training with fruit trees, bushes, and vines at Awbury''s Agricultural Village.  10am-4pm.  $50 general public, $25 for POP partners.  BYO lunch. Registration required at http://www.awbury.org/hearth-hort.','2013-01-02 21:24:59','2013-01-26 00:55:08',NULL,NULL,0),(166,'NORTH PHILLY PRUNING WORKSHOP','2013-02-03 11:00:00','Village of Arts, 2544 Germantown Ave, North Philly','VILLAGE/FAIRHILL','POP Director Phil Forsyth will teach correct pruning for maximum health and production of fruit trees and berry bushes. Dress warmly as a large portion of the workshop will be hands-on pruning at the Village of Arts, Fairhill Burial Ground, and other nearby orchard sites. $10 suggested donation for general public, free for POP partners. BYO lunch. RSVP required below. ','2013-01-22 15:37:08','2013-01-23 19:29:27',NULL,NULL,1),(167,'SOUTH PHILLY PRUNING WORKSHOP','2013-02-23 11:00:00','SPOAC, 1430 E. Passyunk Ave, South Philly','SPOAC','Kevin Stutler and POP Director Phil Forsyth will teach correct pruning for maximum health and production of fruit t