ard Day at Awbury Arboretum!  Join us in weeding and planting the Awbury Food Forest starting at 10am, to be followed by fun activities including cider pressing, apple sauce making, farm and orchard tours, family nature GIS scavenger hunt, hay rides, beekeeping demonstration and an early dinner from 3 to 5 with Zea Mays Native American Cuisine. ','2013-09-30 22:05:03','2013-09-30 22:05:03',NULL,NULL,1),(208,'ORCHARD DAY','2013-10-26 12:00:00','Bartram''s Garden, 5400 Lindbergh Blvd, West Philly','BARTRAM''S GARDEN','Check out this lively Harvest Festival hosted by the Urban Nutrition Initiative at Bartram''s Garden Community Farm!  Garlic planting, cooking demos, face painting, music by DJ DuiJi 13, performance by Hardwork Movement, and much more.  12-3pm. ','2013-09-30 22:18:46','2013-09-30 22:18:46',NULL,NULL,1),(209,'ORCHARD DAY','2013-10-26 15:00:00','Grumblethorpe, 5267 Germantown Ave, North Philly','GRUMBLETHORPE','Celebrate Orchard Day at Historic Grumblethorpe!  Activities include scarecrow making, apple-tasting, and tours of the farm, orchard, and historic house. 3pm-6pm.  ','2013-09-30 22:24:26','2013-09-30 22:24:26',NULL,NULL,1),(210,'ORCHARD DAY','2013-10-26 11:00:00','SHARE, 2901 Hunting Park Ave, North Philly','SHARE','Celebrate Orchard Day with live music, cider pressing, pumpkin patch, and apple/pumpkin bake off at the SHARE Food Program Farm!  11am-2pm. To participate in the baking contest (with prizes!), contact Anna: apaulk@sharefoodprogram.org, 215-223-3028 x106.  ','2013-10-01 14:51:21','2013-10-02 19:39:06',NULL,NULL,1),(211,'ORCHARD DAY','2013-10-26 10:00:00','Teens 4 Good Farm, 8th & Poplar St, North Philly','TEENS 4 GOOD','Get your hands dirty with planting a new berry garden, pawpaws, kiwis, and weeding and mulching in the existing orchard at the original Teens 4 Good Farm!  Snacks and refreshments included. 10am-1pm.  ','2013-10-01 14:55:48','2013-10-01 14:55:48',NULL,NULL,1),(212,'ORCHARD DAY','2013-10-26 09:30:00','Ogden Gardens, Preston