fall plant sale, part of Awbury Arboretum''s Fall Harvest Festival. A wide variety of fruit trees, berry bushes, fruiting vines, and other common and uncommon permaculture plants will be available for sale.','2014-09-05 20:33:30','2014-10-08 19:32:23',NULL,NULL,0),(259,'PLANTING','2014-09-27 10:00:00','Solid Rock United Methodist, 199 E. Tabor Rd, North Philly  ','SOLID ROCK ORCHARD','Help transform POP''s newest orchard into a food forest, with fruit trees, berry bushes, and lots of perennials and groundcovers! A partnership between Solid Rock United Methodist Church, Project for Sacred Places, and POP. ','2014-09-11 13:55:17','2014-09-11 14:35:11',NULL,20,1),(260,'PLANTING','2014-10-11 11:00:00','Horticulture Center, 100 N. Horticultural Dr, West Fairmount Park ','HORT CENTER ORCHARD','WE HAVE ENOUGH VOLUNTEERS FOR THIS EVENT, THANKS!  Join us in the planting a thousand perennials and grouncovers at  the new food forest demonstration garden at the Fairmount Park Horticulture Center. A collaboration between POP, Parks & Rec, and the Philadelphia Master Gardeners.  ','2014-09-11 14:16:30','2014-09-29 12:54:20',NULL,30,1),(261,'HAPPY HOUR','2014-10-15 17:00:00','McGillin''s Old Ale House, 1310 Drury St, Center City','McGILLIN''S','Join us for our Philadelphia Orchard Week Happy Hour at McGillin''s Old Ale House, the city''s oldest pub.  Enjoy food and drinks in support of POP''s work to plant more community orchards in the city!  Featuring drink specials and raffle items from Angry Orchards and Fireball.  5pm - 8pm.  Site info: http://www.mcgillins.com/','2014-09-11 14:34:38','2014-09-29 15:02:39',NULL,NULL,1),(263,'ORCHARD DAY','2014-10-18 10:00:00','Awbury Ag Village, 1011 E. Washington Lane, NW Philly','AWBURY','This fun fall festival event will feature hayrides, ciderpressing, pumpkin painting, crafts for kids, a flea market, music, food, and more.  And don''t miss POP''s annual plant sale!  10am to 3pm.  More info: http://awbury.org/','2014-09-18 15:29:40','2014-09-18 15:29:40',NULL,NULL,1),(264,'ORCHARD DAY','2014-10-18 11:00:00','Mill Creek Farm, 49th & Brown St, West Philly','MILL CREEK','Mill Creek Farm will host a work day from to prune, mulch and plant in their orchard, one of the most productive in the city.  A potluck lunch will follow at 1:30 pm.  Mill Creek will provide apples and juice and their produce will be available for sale at their weekly farm stand, from 11 am- 2 pm.\nSite info: http://millcreekurbanfarm.org/','2014-09-18 15:38:16','2014-09-18 15:52:16',NULL,NULL,1),(265,'ORCHARD DAY','2014-10-18 10:00:00','Woodford Mansion, NW of 33rd & Dauphin, East Fairmount Park ','WOODFORD','Enjoy this fun community celebration of the fall harvest! Woodford''s 6th annual Apple Fest will feature cider-pressing, heirloom apple tasting, pumpkin painting and crafts, blacksmithing demonstration and tours of the orchard and historic Woodford.  Volunteer in the orchard 10am to noon and join the festival noon to 2pm.  \nRAINDATE: Sunday, 10/19\nSite info: http://www.woodfordmansion.org/','2014-09-18 15:44:29','2014-09-18 15:53:04',NULL,NULL,1),(266,'ORCHARD DAY','2014-10-18 10:00:00','Fair Hill Burial Ground, 2901 Germantown Ave, North Philly  ','FAIR HILL','Join in the fun as Historic Fair Hill hosts a harvest festival and work day from 10am to 3pm. Admission is free and includes popcorn, hot apple cider, corn-husk doll making and other crafts for kids. Volunteers are welcome to help with harvesting gingko nuts, building compost bins and planting peach trees, strawberries, and cover crops.  \nSite info: http://www.historicfairhill.org/','2014-09-18 15:51:34','2014-10-13 14:29:36',NULL,NULL,1),(267,'ORCHARD DAY','2014-10-18 13:00:00','Solid Rock United Methodist, 199 E. Tabor Rd, North Philly','SOLID ROCK','Enjoy a bit of country in the city with the Harvest Festival at Solid Rock Church!  Event features pumpkin picking and painting, music, games, food, and more. 1pm to 5pm.','2014-09-18 16:00:39','2014-09-18 16:00:39',NULL,NULL,1),(268,'ORCHARD DAY','2014-10-19 13:00:00','Bartram''s Garden, 5400 Lindbergh Blvd, West Philly','BARTRAM''S','Check out this lively Harvest Festival hosted by the Urban Nutrition Initiative at Bartram''s Garden Community Farm!  Event features ciderpressing, canoe and hayrides, games, crafts, garden workshops, fruit tree planting, food and much more. 1pm - 4pm. \nMore details: http://www.urbannutrition.org/2014/09/harvest-festival-2014/\nSite info: http://www.bartramsgarden.org/','2014-09-18 16:40:26','2014-09-18 16:41:27',NULL,NULL,1),(269,'ORCHARD DAY','2014-10-19 10:00:00','Francisville Orchard, 815 Perkiomen St, North Philly','FRANCISVILLE','Celebrate the harvest season at Francisville Orchard with tree planting, food demos, live chickens & a chicken care workshop, pumpkin carving and other kids activities, a cookout, and more! 10am to 3pm. Site info: urbanstead.org','2014-09-18 16:49:33','2014-10-08 19:33:44',NULL,NULL,1),(270,'ORCHARD DAY','2014-10-19 15:00:00','Grumblethorpe, 5267 Germantown Ave, North Philly ','GRUMBLETHORPE','Celebrate Orchard Day at Historic Grumblethorpe with scarecrow making and a haunted house tour!  3pm-6pm.  \nSite info: http://www.philalandmarks.org/grum.aspx','2014-09-19 15:06:20','2014-09-19 15:06:20',NULL,NULL,1),(271,'CRABAPPLE HARVEST','2014-09-27 11:00:00','St. Mary''s Church @ UPenn, 3916 Locust Walk,  West Philly','UPENN','WE HAVE ENOUGH VOLUNTEERS FOR THIS EVENT, THANKS!  Join us in picking an abundance of crabapples and learn about this under-appreciated fruit. UPenn has given POP full reign to pick all the fruit on campus and we''ve got a treasure map of planting locations. Sample some, bring some home, and learn about processing into beautiful crabapple jelly. ','2014-09-20 19:52:33','2014-09-25 13:27:40',NULL,20,1),(272,'POUR THE CORE','2014-09-27 13:01:00','Navy Yard, 4747 S. Broad St, South Philly','CIDER FEST','Love apples? Then, drink apples! Gather with fellow apple enthusiasts, hard cider aficionados, fermentation zealots, and craft beverage fanatics for the second annual Pour The Core: Philly hard cider festival. Stop by POP''s table! 1pm -5pm.  More info & tickets: http://www.pourthecore.com/philly','2014-09-20 19:59:26','2014-09-24 13:03:25',NULL,NULL,0),(273,'WORKSHOP','2014-09-27 13:00:00','Center for Culinary Enterprises, 310 S. 48th St, West Philly','CRABAPPLE JELLY','Immediately following our crabapple harvest at UPenn, we''ll head to the Center for Culinary Enterprises to get hands-on jelly-making & canning experience from Molly Haendler, owner of West Philly''s own Spruce Hill Preserves. To help cover costs, we''re asking $10 for the workshop. Everyone will go home with delicious jelly & preservation knowledge.','2014-09-24 13:02:41','2014-09-24 13:02:41',NULL,12,1),(274,'HARVEST FEST','2014-10-12 12:00:00','Eakins Oval, 3007 Benjamin Franklin Pkwy, Center City','EAKINS OVAL','Stop by to help POP press fresh apple cider at the 2014 Parks & Rec Harvest Festival.  This urban county fair event will also include a ferris wheel, petting zoo, hay maze, food, music and more, all right in front of the Art Museum!  12pm- 5pm','2014-09-24 22:12:43','2014-09-24 22:12:43',NULL,NULL,0),(275,'PLANTING','2014-10-23 13:00:00','Penn Park, UPenn Campus, West Philly','PENN PARK ORCHARD','WE HAVE ENOUGH VOLUNTEERS FOR THIS EVENT, THANKS!  Help plant a brand new educational orchard in Penn Park on University of Pennsylvania campus.  This event will proceed as scheduled, RAIN OR SHINE!','2014-09-29 18:00:50','2014-10-22 23:40:47',NULL,25,1),(276,'PLANTING','2014-11-08 10:00:00','Gorgas Park Garden, Acorn St & Ridge Ave, NW Philly','T4G GORGAS ORCHARD','Help youth from Teens 4 Good in planting a brand new orchard at Gorgas Park in Roxborough.  A partnership between POP, Teens 4 Good, North Light Community Center, and Parks & Rec. ','2014-09-29 21:05:05','2014-09-29 21:05:05',NULL,10,1),(277,'PLANTING','2014-10-26 14:00:00','Tablespread Farm, 47th & Westminster Ave, West Philly','TABLESPREAD ORCHARD','Lend a hand in planting fruit trees at brand new orchard partner Tablespread, a cooperative community farm in West Philly''s Mill Creek neighborhood.  THIS EVENT RESCHEDULED from original date of 10/25. ','2014-10-01 13:08:12','2014-10-22 21:30:27',NULL,12,1),(278,'ORCHARD DAY','2014-10-18 10:00:00','Teens 4 Good Farm, 8th & Poplar, North Philly','TEENS 4 GOOD','Experience Orchard Day at the Teens 4 Good 8th & Poplar Farm.  Help expand their orchard with new fruit trees & berry bushes, help out with other farm tasks, and enjoy warm apple crisp and other treats!  10am - 2pm.  Site info: http://teens4good.orbius.com/','2014-10-02 14:05:30','2014-10-02 15:45:38',NULL,NULL,1),(279,'ORCHARD DAY','2014-10-19 12:00:00','South Philly Teen Orchard, 2011 S. 8th St, South Philly','SOUTH PHILLY','Join in this fall festival at the South Philly Teen Orchard, with cider-pressing, pies and other treats, and tours of the orchard and gardens!  12 - 3pm','2014-10-02 15:38:15','2014-10-02 15:46:01',NULL,NULL,1),(280,'GINGKO HARVEST','2014-10-14 17:00:00','Fair Hill Burial Ground, 2901 Germantown Ave, North Philly','POSTPONED','THIS EVENT HAS BEEN POSTPONED and now will be part of Philadelphia Orchard Day at Fair Hill on Saturday 10/18, see posting below.  ','2014-10-03 19:27:09','2014-10-13 14:26:55',NULL,NULL,0),(281,'ORCHARD DAY','2014-10-18 14:00:00','Tertulias Herb Garden, 2204 N. 2nd St, North Philly','TERTULIAS','Enjoy Orchard Day with kids art activities, Puerto Rican cooking, and a medicinal herb walk at the Tertulias orchard and herb garden.  Tertulias is part of a neighborhood of beautiful themed gardens in Norris Square. 2pm - 5pm.  ','2014-10-06 14:20:31','2014-10-06 14:20:31',NULL,NULL,1),(282,'FARM FEST','2014-11-01 11:00:00','Mill Creek Farm, 49th & Brown St, West Philly ','MILL CREEK','Join in the fun at the Mill Creek Farm Festival, featuring a costume parade, pie contest, cider-pressing, face-painting, kids games, capoeira and west african dance, farmers market and block party!  11am to 3pm.  \nSite info: http://millcreekurbanfarm.org/  ','2014-10-08 23:22:26','2014-10-08 23:22:26',NULL,NULL,0),(283,'WORK DAY','2014-10-29 13:00:00','Awbury Ag Village, 1011 E. Washington Ln, NW Philly','AWBURY ORCHARD','Help out with weeding and planting new perennials and groundcovers at the Awbury Food Forest.  1pm -5pm. RSVP to receive more specific directions. ','2014-10-23 22:10:22','2014-10-23 22:10:22',NULL,5,1),(284,'FRUIT PRUNING WORKSHOP','2015-01-31 13:00:00','Grumblethorpe, 5267 Germantown Ave, NW Philly','GRUMBLETHORPE','SOLD OUT!  Join us for a pruning workshop at Historic Grumblethorpe led by POP''s Phil Forsyth and Kevin Stutler. A classroom session will introduce the basics of pruning fruit trees & berry bushes, followed by an afternoon of hands-on training on the wide range fruit planted in Grumblethorpe''s gardens.  Space is limited to only 20 participants! $20 general public, $10 POP partners & volunteers.  Snowdate: Sunday 2/1 @ 1pm. \nPRE-REGISTRATION REQUIRED:\nhttp://phillyorchards.eventbee.com/event?eid=126526573','2014-12-12 20:13:49','2015-01-28 21:34:31',NULL,NULL,0),(285,'BIO-DYNAMIC ORCHARD WORKSHOP','2015-01-17 10:00:00','Awbury Arboretum Cope House, 1 Awbury Rd, NW Philly','AWBURY','Learn the basics of biodynamic orchard practice with Sebastian Kretschmer of One Village Farm. This introductory workshop will discuss the biodynamic approach to growing fruit without chemical pesticides, with a focus on soil preparation, pest control and key biodynamic preparation sprays and pastes. $30/$20.  Pre-registration required:\nhttp://awbury.org/events/biodynamic-orchard-workshop/','2014-12-12 20:28:33','2014-12-17 18:55:22',NULL,NULL,0),(286,'FRUIT GRAFTING WORKSHOP','2015-03-14 13:00:00','Bartram''s Garden, 5400 Lindbergh Blvd, West Philly','BARTRAM''S GARDEN','Learn all the basics of fruit tree grafting from Dr. Lee Reich, author of Grow Fruit Naturally, Landscaping with Fruit, and The Pruning Book. All attendees will graft their own pear or Asian pear tree to bring home or donate to POP. $60/$50.  Space is limited, advance registration required: http://leereichphilly.bpt.me/','2014-12-12 20:32:57','2014-12-16 18:29:32',NULL,NULL,0),(287,'PERMACULTURE DESIGN COURSE','2015-03-21 10:46:00','Heritage Farm, 4300 Monument Road, West Philadelphia',NULL,'POP is co-sponsoring the first ever full Permaculture Design Course in Philadelphia!  March 21 & 22 kick off an 11 day course running monthly through September. Organized by Susquehanna Permaculture with classes led by Ben Weiss, Melissa Miles, Wilson Alvarez, and guest speakers. For more information, full schedule, and pricing: http://susquehannapc.com/permaculture-courses/pdcs-2/pdcs/','2014-12-22 16:50:32','2015-01-05 14:46:27','March 21 & 22',NULL,0),(288,'ECO-ORCHARD WORKSHOP','2015-02-28 10:00:00','Kingsessing Branch Library, 1201 S. 51st St, West Philly','EARTH''S KEEPERS','Earth''s Keepers is hosting a workshop on ecological orchard care led by POP''s Phil Forsyth and Kevin Stutler. A morning classroom session will look at a year in orchard care, describing seasonal tasks including pruning, thinning, and the use of holistic sprays. A brown-bag lunch will be followed by an afternoon of hands-on pruning and compost tea application on the farm, which adjoins the library. 10am to 2pm. $20 for general public, $10 for POP partners and volunteers. Space is limited, pre-registration required:  http://phillyorchards.eventbee.com/event?eid=148028962','2015-02-09 15:20:13','2015-02-09 15:20:13',NULL,NULL,0);
